import React from 'react'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	flex-direction: column;
	position: relative;
	background-color: orange;
/*	width: 788px;
	height: 100%;*/


	&::after {
		height: 100vh;
		width: 4px;
		content: '';
		background-color: red;
		margin-left: auto;
		margin-right: auto;
	}

`;

function Timeline(props) {
	return (
		<Style>
			{props.children}
		</Style>
	)
}

export default Timeline;
